import './Logement.css';

function Logement({ logement }) {


  return (
    <div className="logement-wrapper">
      <p>{logement.adresse}</p>
      <p>{logement.type}</p>
      <p>{logement.surface}</p>
      <p>{logement.price}</p>
    </div>
  );

}

export default Logement;
